import React, { useState, Fragment } from "react";
import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";


function MainNav() {
  return (
      <Router>
    <div>
      <nav>
        <h1>Hello</h1>
      </nav>
    </div>
    <Switch>
        <Route exact path={'/posts/'} />
    </Switch>
      </Router>
  );
}

export default MainNav;
